import React, { Component } from 'react'

class Toggle extends Component {

    state = {
        switch1: true,
        switch2: false
      }

      handleSwitchChange = nr => () => {
        let switchNumber = `switch${nr}`;
        this.setState({
          [switchNumber]: !this.state[switchNumber]
        });
      }

    render() {
        return (
            <div>
                Hello World
            </div>
        )
    }
}

export default Toggle;
